import React, { useEffect, useState } from "react";
import axios from "axios";

const baseURL = "https://restcountries.com/v2/all";

const Home = () => {

    const [data, setData] = useState([]);

    useEffect(() => {

        axios.get(baseURL).then((response) => setData(response.data.map(obj => (
            data.push({
                name : obj['name'],
                capital : obj['capital']
            })
        ))));

    },[])

    return(
        <div>
            data[0].name
        </div>
    );
};

export default Home;
